export default function PageWithForm({name, title, children, buttonTitle, onSubmit}) {

    return (
        <section className={name} id={className}>
            <div className={`${className}__container`}>
                <form className="form" name={`${name}Form`} onSubmit={ onSubmit }>
                    <h2 className="form__heading">{`${title}`}</h2>
                    <fieldset className="form__fields">
                        {children}
                    </fieldset>
                    <button type="submit" className="form-button">{ buttonTitle }</button>
                </form>
            </div>
        </section>
    )
}
